@import './config';

.header{
  margin-top:4rem;
  display: flex;
  justify-content: center;
  align-items: center;
  width:100vw;
  height: 30vh;
  & .planet-wrapper{
    position: relative;
    width:30%;
    height: 100%;
    & .planet{
      position: absolute;
      width:250px;
      height: 250px;
      top:5%;
      left:20%;
      & img{
        width:100%;
        height: 100%;
      }
    }
    & .ship1{
      position: absolute;
      top:80%;
      right:20%;
      width:90px;
      height: 70px;
      transform: rotate(45deg);
      & img{
        width:100%;
        height: 100%;
      }
    }
    & .ship2{
      position: absolute;
      top:50%;
      right:85%;
      width:70px;
      height: 50px;
      transform: rotate(-15deg);
      & img{
        width:100%;
        height: 100%;
      }
    }
    & .ship3{
      position: absolute;
      top:10%;
      right:20%;
      width:60px;
      height: 50px;
      transform: rotate(25deg);
      & img{
        width:100%;
        height: 100%;
      }
    }
  }
  & .header-wrapper{
    position: relative;
    width:50%;
    & .header-desc{
      width:80%;
      height: 80%;
      z-index: 9999;
      & img{
        width:100%;
        height: 100%;
      }
    }
    & .robot{
      position: absolute;
      right: 16%;
      top:20%;
      width:70px;
      height: 120px;
      transform: rotate(65deg);
      z-index: -999;
      & img{
        width:100%;
        height: 100%;
      }
    }
  }
}

