      & .ship3{
        right:10%;
      }
    }
  }
}
@include mediaMd{
  .header{
    margin-top:0;
    flex-direction: column;
    height: 40vh;
    & .planet-wrapper{
      width:90%;
      & .planet{
        left:50%;
        transform: translateX(-50%);
      }
      & .ship1{
        right:10%;
        top:50%;
      }
    }
    & .header-wrapper{
        width:90%;
      & .header-desc{
        margin:0 auto;
      }
      & .robot{
        top:17%;
        right:5%;
      }
    }
  }
}

