      }
    }
    & .header-wrapper{
      width:100%;
      height: 60%;
      & .header-desc{
        height: 100%;
        width: 85%;
        margin:0 auto;
      }
      & .robot{
        right: 55%;
        top:-25%;
        transform: rotate(0deg);
      }
    }
  }
}

